plantuml_diagram:
@startuml
!define AWSPuml https://raw.githubusercontent.com/awslabs/aws-icons-for-plantuml/v20.0/dist
!include AWSPuml/AWSCommon.puml

node "AWS Lambda Function" as lambda <<Go, AWS Lambda Go SDK>> {
}

cloud "AWS S3" as s3
queue "AWS SQS" as sqs
rectangle "IAM Role" as iam

lambda -down-> s3 : Reads/Writes Objects
lambda -down-> sqs : Sends/Receives Messages
lambda -right-> iam : Assumes Role

@enduml
